<template>
    <div class="blogCss">
        <div class="blog">
            <div class="blogTitle">vue 提示模板错误，原来它提供了一系列不同功能的脚本</div>
            <div class="blogContent" v-highlight>
                <p><Icon type="md-checkmark" style="color:green"/> 看看即可 不必在意 vue官网明确说明了默认用哪个</p>
                <hr />
                <p>开发过程中遇到 vue 运行脚手架报错</p>
                <p style="color:red">You are using the runtime-only build of Vue where the template compiler is not available. Either pre-compile the templates into render functions, or use the compiler-included build. </p>
                <p>一直找不到哪里bug了 求大神求有可能哪里出错了</p>
                <img src="data:image/png;base64," alt="">
                <p>原因</p>
                <p>vue有两种形式的代码 compiler（模板）模式和runtime模式（运行时），vue模块的package.json的main字段默认为runtime模式， 指向了"dist/vue.runtime.common.js"位置。</p>
                <p>webpack.config.js 添加如下配置</p>
                <script type="text/html">
                    resolve: {
                        alias: {
                            vue: 'vue/dist/vue.js',
                        }
                    }
                </script>
                <p>或者</p>
                <script type="text/html">
                    import Vue from 'vue/dist/vue.js';
                </script>
                <p>import Vue from ‘vue’ 这行代码被解析为 import Vue from ‘vue/dist/vue.esm.js’，直接指定了文件的位置，没有使用main字段默认的文件位置</p>
                <p>根目录创建一个vue.config.js文件夹，加上如下代码即可。vue cli 3.10.0</p>
                <script type="text/html">
                    module.exports = {
                      runtimeCompiler: true
                    }
                </script>
                <p>在vue cli3 中</p>
                <script type="text/html">
                    chainWebpack: config => {
                        config.resolve.alias
                            .set('vue', resolve('vue/dist/vue.esm.js')) // 指定vue版本 - es6完整版本
                    }
                </script>
                <p><a href="https://segmentfault.com/q/1010000010380119">https://segmentfault.com/q/1010000010380119</a></p>
            </div>
            <div class="blogFooter">
